import React from 'react';
import Book1 from './OpeningBooks/Book1';
import Book2 from './OpeningBooks/Book2';
import Book3 from './OpeningBooks/Book3';
import Book4 from './OpeningBooks/Book4';
import Book5 from './OpeningBooks/Book5';
import Book6 from './OpeningBooks/Book6';
import Book7 from './OpeningBooks/Book7';
import Slider from 'react-slick';

const BookLineUp = () => {

    const settings = {
        dots: true,
        infinite: false,
        speed: 500,
        slidesToShow: 4,
        slidesToScroll: 4,
        initialSlide: 0,
        responsive: [
            {
                breakpoint: 1024,
                settings: {
                slidesToShow: 3,
                slidesToScroll: 3,
                infinite: true,
                dots: true
                }
            },
            {
                breakpoint: 600,
                settings: {
                slidesToShow: 2,
                slidesToScroll: 2,
                initialSlide: 2
                }
            },
            {
                breakpoint: 480,
                settings: {
                slidesToShow: 1,
                slidesToScroll: 1
                }
            }
        ]
    };

    return (
        <>
            <Slider {...settings}>
                <div>
                    <Book1 />
                </div>
                <div>
                    <Book2 />
                </div>
                <div>
                    <Book3 />
                </div>
                
                    <Book4 />
                
                    <Book5 />
                
                    <Book6 />
                
                    <Book7 />
                
            </Slider>
        </>
    );
};

export default BookLineUp;
